But to save a few bucks and keep from going completely off track I made my super easy buffalo chicken flat bread for dinner.

I always have these items in my pantry/fridge and is a great go to meal when I'm feeling really lazy.

1 can of premium chicken breast (12oz)
Franks red hot
Fiber filled flat bread (I love Joseph's brand.)
Olive oil to brush bread
Low fat mozzarella and parm.

Brush bread with olive oil.
 Drain and mix chicken with desired amount of franks red hot. 
Sprinkle flat bread with 1/2 cup mozzarella and top with franks red hot chicken and sprinkle with 1/4 cup shredded parm.

I did use my containers to measure so I at least know what my portions are, not a perfect dinner but a pretty good Friday night fix.

I split this with Brandon so 1/2 of this flat bread is only slightly over my portion plan.

It equals:
1/2 a serving of healthy carbs at only 60cals. 

1.5 serving of cheese (healthy fat)(.5 more than my plan allows)

1 serving (6oz) of protein

And 1 tsp oil. 

If I had a salad with this it would be pretty dang healthy actually.

Super easy for the kids use marinara sauce and leave off the chicken.
And let them add whatever toppings they like.

